@AShenningsen Man kan da godt argumentere for, at der er en CO2-udledning forbundet med importerede varer. Men samtidig eksporterer vi også meget - og har handelsoverskud og brødføder fx. mio i udlandet. 

Beregninger for Tyskland peger på deres CO2 efter import er ca. +13%.

